import emailjs from "emailjs-com";
import React, { useState } from "react";
import "./contactForm.css";
import { Link } from "react-router-dom";
import { Button } from "./Button";

function ContactUs() {
  function sendEmail(e) {
    console.log("sends mail");
    e.preventDefault();
    emailjs
      .sendForm(
        "service_gk688ip",
        "template_t8bvc8d",
        e.target,
        "user_LLQ9jJYKS5bbiRNCrgoJ7"
      )
      .then(
        (result) => {
          console.log(result.text);
        },
        (error) => {
          console.log(error.text);
        }
      );
    e.target.reset();
    alert("בקשתך התקבלה במערכת, נציגנו יחזרו אליך בהקדם");
  }
  const [done, setDone] = useState(false);
  const handleDone = () => {
    console.log("Submit");
    setDone(true);
  };
  return (
    <>
      <video src="/videos/Typing_dark.mp4" autoPlay loop muted />
      <div className={!done ? "done" : "hide"}>
        <div className="ty">
          <Button
            className="btns"
            buttonStyle="btn--primary"
            buttonSize="btn--large"
            to="/contact"
            onClick={console.log("hey")}
          >
            SEND A REQUEST <i class="fas fa-paper-plane"></i>
          </Button>
          <h1>
            תודה שבחרת <span className="stringel">סטרינגל</span>
            <br />
            <Link to="/">
              <div className="link">חזרה לדף הבית</div>
            </Link>
            <Link to="/Resume">
              <div className="link">לעמוד המתכנתים שלנו</div>
            </Link>
          </h1>
        </div>
      </div>
      <div className={!done ? "hide" : "wrapper"}>
        <div className="title">
          <h1>מלא את פרטיך ונחזור אליך בהקדם</h1>
        </div>
        <div className="contact-form">
          <div className="input-fields">
            <form id="form" onSubmit={sendEmail}>
              <input
                type="text"
                className="input"
                placeholder="שם"
                name="name"
                id="name"
              />
              <input
                type="text"
                name="email"
                id="email"
                className="input"
                placeholder="כתובת אימייל"
              />
              <input
                type="text"
                className="input"
                placeholder="מספר פלאפון לחזרה"
                name="phone"
                id="phone"
              />
              <input
                type="text"
                className="input"
                placeholder="תיאור הבקשה"
                name="message"
                id="message"
              />
              <div className="btnContactForm">
                <input
                  onClick={handleDone}
                  type="submit"
                  value="שלח פנייה"
                  className="submit-btn"
                ></input>
              </div>
            </form>
          </div>
        </div>
        <h2 className="phone-num">:אנו זמינים בטלפון </h2>
        <h2 className="phone-num">052-708-8919</h2>
      </div>
    </>
  );
}

export default ContactUs;
